import axios from 'axios';
import React, { Component } from 'react';
import { Table, Col, Row, Tab} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'


class UsuariosList extends React.Component {
        state = {
            usuarios: []
        }

    componentDidMount() {
        axios.get('http://localhost:8080/getUsuarios')
        .then(res => {
            console.log(res);
            this.setState({ usuarios: res.data })
        })
    }

    render() {
        return (
            <Table>
                <Row>
                    <Col>Nombre</Col>
                    <Col>Apellidos</Col>
                    <Col>Dni</Col>
                    <Col>Centro de Vacunacion</Col>
                    <Col>Rol</Col>
                </Row>
                {this.state.usuarios.map(usuario =>
                    <Row>
                        <Col>Nombre: {usuario.nombre}</Col>
                        <Col>Apellidos: {usuario.apellido}</Col>
                        <Col>DNI: {usuario.dni}</Col>
                        <Col>Centro de Vacunacion: {usuario.centroSalud}</Col>
                        <Col>Rol: {usuario.rol}</Col>
                    </Row>
                    )}
            </Table>
        );
    }
}

export default UsuariosList
